import React from 'react';
import './App.css';
import mainPic from './466F17BB-45C1-460B-9415-F1427BD8C142_1_105_c.jpeg'

function App() {
  return (
    <div >
        <div className='navbar'>
          <h5 style={{fontSize: '48px'}}>Matthew & Jenafer</h5>
          <ul>
            <li>Home</li>
            <li>Schedule</li>
            <li>Photos</li>
            <li>FAQ's</li>
            <li>RSVP</li>
          </ul>
        </div>
        <img className='mainPic' src={mainPic} alt= 'MattJena' />
        <p className='centerText padding bigText'>Join <br/> Matthew Rodriguez <br/> and <br/> Jenafer Morton < br/><span style={{fontFamily: 'Playfair Display', paddingTop: '30px'}}> <br/> 6 | 12 | 2020 <br/><span style={{fontSize: '26px', fontFamily: 'Barlow Condensed'}}>#MATTANDJENA2020</span></span></p>
        <p style={{fontFamily:'Playfair Display'}}>Friday, June 12, 2020 <br/><br/>7:00 pm - 1:00 AM</p>
        <h1 className='centerText padding'>ayyaya</h1>
        <h1 className='centerText padding'>ayyaya</h1>
    </div>
  );
}

export default App;
